import React from "react";
import Card from "react-bootstrap/Card";

function Project(props) {
    const projects = props.projects;

    return (
        <div>
            {projects.map((project, index) => (
                <Card key={index} style={{ width: "18rem" }}>
                    <Card.Img
                        variant="top"
                        src={require(`../../assets/images/${project.image}`)}
                        className="card-image"
                    />
                    <Card.Body>
                        <Card.Title className="card-title">{project.name}</Card.Title>
                        <Card.Text className="card-text">{project.description}</Card.Text>
                        <Card.Subtitle>
                            <Card.Link href={project.live} target="_blank">App Link</Card.Link>
                            <br />
                            <Card.Link href={project.github} target="_blank">Github Repo</Card.Link>
                        </Card.Subtitle>
                    </Card.Body>
                </Card>
            ))}
        </div>
    );
}

export default Project;
